    "plt.xlabel(r'$x$-position [a.u.]')\n",
    "plt.ylabel(r'$y$-position [a.u.]')\n",
    "plt.savefig('Radial Wavefunctions 2p orbital.svg', bbox_inches='tight')\n",
    "plt.show()"
