    "ax4.set_ylabel(r'Surface Area / $4\\pi r^{2}$')\n",
    "ax4.set_title(r'Sphere Surface Area Over $4\\pi$')\n",
    "plt.savefig('Probability density 3p orbital.svg', bbox_inches='tight')\n",
    "plt.show()"
